1,16337112),(97,'2019-03-04 21:49:26.916049','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','习近平新时代中国特色社会主义思想，是党和人民实践经验和集体智慧的结晶，内涵十分丰富，包括新时代坚持和发展中国特色社会主义的总目标、总任务、总体布局、战略布局和发展方向、发展方式、发展动力、战略步骤、外部条件、政治保证等方面的基本问题，对中国社会的方方面面和党的建设等各个方面作出理论分析和政策指导，是党和国家必须长期坚持的指导思想。',1,16337174),(98,'2019-03-04 22:03:24.134731','辽宁打造新时代学雷锋高地','雷锋是时代的楷模，雷锋精神是永恒的。实现中华民族伟大复兴，需要更多时代楷模。我们既要学习雷锋的精神，也要学习雷锋的做法，把崇高理想信念和道德品质追求转化为具体行动，体现在平凡的工作生活中，作出自己应有的贡献，把雷锋精神代代传承下去。',1,17341099),(99,'2019-03-04 22:05:13.614512','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','经过长期探索，我们已经找到一条适合中国国情的正确发展道路，中国特色社会主义是中国共产党和中国人民团结的旗帜、奋进的旗帜、胜利的旗帜。一个国家的发展道路合不合适，只有这个国家的人民才最有发言权。改革开放以来，党团结带领全国各族人民，高举中国特色社会主义伟大旗帜，不懈奋斗，推动我国经济实力、科技实力、国防实力、综合国力进入世界前列，推动我国国际地位实现前所未有的提升，中华民族正以崭新姿态屹立于世界的东方。只要我们紧紧依靠13亿多中国人民，坚定不移走自己的路，我们就一定能战胜一切艰难险阻，不断取得新的成绩...',1,16337191),(100,'2019-03-04 22:30:17.987424','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','中国特色社会主义思想是党和人民经过长期努力奋斗，取得的宝贵成果。改革开放以来，党和国家取得一切成绩和进步的根本原因，归结起来就是：开辟了中国特色社会主义道路，形成了中国特色社会主义理论体系，确立了中国特色社会主义制度，发展了中国特色社会主义文化，这是中国特色社会主义的根本标志。习近平强调“一切向前走，都不能忘记走过的路……面向未来，面对挑战，全党同志一定要不忘初心、继续前进”，我们要更加自觉地坚定这四个方面的自信，即道路自信、理论自信、制度自信、文化自信。',1,16337174),(101,'2019-03-04 22:47:59.535015','120倍偿还50年前欠款 浙江乌镇98岁“诚信奶奶”冒雨还债','人无信不立。诚信是做人的基本准则，失去诚信，人就无法在社会立足;拥有诚信，就拥有了立足之本。国无信无以自强。国家机构、国家领导也要处处以诚信为本，不弄虚作假，不负人民期望。如此人民更有幸福感，国家更富盛强。',1,18340075),(102,'2019-03-04 23:01:11.254675','我国今年计划发射8-10颗北斗导航卫星','我国北斗系统的不断完善、不断进步，一方面体现我国对自研技术的重视，另一方面体现我国日益进步的科研力量。钻研自主知识产权的技术，不再依赖外国，是我国迈向科技强国的必经之路，也是中华民族伟大复兴的必由之路。相信在未来的5G时代，我们会有更多属于自己的技术，自力更生迈向未来。',1,18340075),(103,'2019-03-04 23:11:26.972937','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','每个时代都需要引领性的思想理论。习总书记的思想是在马克思列宁主义，毛泽东思想，邓小平理论，三个代表重要思想科学发展观的基础上从2013年开始逐步建立完善起来的，直到2017年底才基本成型，有了自己的内核。新时代理论突出体现了与时俱进，不断前进的理念。必须长期坚持新时代中国特色社会主义思想，这样中国特色社会主义道路才会越走越好',1,17341105),(104,'2019-03-04 23:15:22.052430','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','历史已经证明无论是君主立宪制还是民主共和制都不适合中国的发展。无论是洋务运动，戊戌变法，辛亥革命，还是照搬照抄苏联的社会主义制度，都救不了中国。只有坚持和发展中国特色社会主义，才是中国发展进步的根本方向。只有坚持“四个自信”，不忘初心，继续前进，我们的国家才能迅速发展，更快走向社会主义现代化',1,17341105),(105,'2019-03-04 23:57:36.116885','听总书记讲新时代学雷锋','积小善为大善，善莫大焉，这和我们党‘为人民服务’‘做人民勤务员’是一脉相承的，所以雷锋精神永远值得弘扬。”党的宗旨是为人民服务，雷锋精神完美阐释了党的宗旨，是我们所有人值得学习的。',1,15336121),(106,'2019-03-05 00:07:54.745128','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','任何一种思想的确立，都有其内在的理论逻辑。作为马克思主义中国化最新成果和中国共产党人新的行动指南，习近平新时代中国特色社会主义思想更是一个集时代性、原创性与系统性于一体的科学体系。习近平新时代中国特色社会主义指导思想的逐步完善让中国特色社会主义制度进一步发展，我们应始终高举中国特色社会主义的旗帜，坚定不移地走中国特色社会主义，坚持党的领导，我们才能实现中华民族的伟大复兴，建成富强民主文明和谐美丽的社会主义工业化强国',1,15336121),(107,'2019-03-05 00:15:54.490026','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','只有社会主义才能救中国，只有坚持和发展中国特色社会主义才能实现中华民族伟大复兴。坚持和发展中国特色社会主义是改革开放以来党的全面理论和实践的主题，是当代中国发展进步的根本方向。习近平总书记指出，中国特色社会主义是党和人民长期奋斗、创造、积累的根本成就。经过长期努力，中国特色社会主义进入了新时代，这是我国发展新的历史方位。新时代新作风，中国特色社会主义进入了新的历史时期并不是说我们要改变我们的道路，而是应该继续坚持和发展中国特色社会主义，继续坚持党的领导',1,15336121),(108,'2019-03-05 11:53:32.643423','风正帆悬——人民政协 70年再出发','2019年，人民政协将迎来70周年华诞，要把加强思想政治引领、广泛凝聚共识作为履职工作的中心环节，加强各党派团体、各族各界人士大团结大联合，担负起把中共中央对人民政协工作的要求落实下去、把海内外中华儿女实现中华民族伟大复兴中国梦的智慧和力量凝聚起来的政治责任，以优异成绩迎接新中国成立70周年。',1,18340069),(109,'2019-03-05 11:55:21.991497','代表委员畅谈新中国七十年辉煌历程：可爱的中国（社会建设篇）','新中国成立七十年来，党和国家始终坚持在发展中保障和改善民生，全面推进幼有所育、学有所教、劳有所得、病有所医、老有所养、住有所居、弱有所扶，不断改善人民生活、增进人民福祉。全面建成小康社会惠及十几亿人口，是实现中华民族伟大复兴的重要基础和关键一步，是每一个中国人的幸福所在、责任所在。',1,17341074),(110,'2019-03-05 11:56:07.798583','为党和人民继续前进提供强大精神激励——全国政协文艺界社科界委员畅谈聆听习近平总书记讲话心得','习近平总书记指出:一切优秀文艺工作者的艺术生命都源于人民，一切优秀文艺创作都为了人民。当今时代文艺作品必须具有振奋人心、催人奋进的力量。那些优秀的文艺作品代表着时代进步的思想，理应再次吹响了以文化自信为底蕴、以伟大灵魂和作品为动力，为党和人民继续前进提供强大精神激励的进军号角。',1,17341074),(111,'2019-03-05 11:56:52.780399','国务院办公厅关于成立中国国际进口博览会组委会的通知','国务院办公厅着手组建中国国际进口博览会组委会，标志着在经济全球化、货物互通往来的当下，我国政府积极融入时代潮流，并争做时代领航员的决心，此次国际进口博览会组委会的组建，将推动落实我们国家邀请其他国家、地区和国际组织参展，也有助于提升我国的国际地位',1,17341073),(112,'2019-03-05 11:58:12.082831','第二十九讲：努力掌握马克思主义思想方法和工作方法','“八个坚持”的思想方法和工作方法是对习近平总书记强调的思维方法的发展，实事求是、问题导向与调查研究其实是一回事，搞清楚“实事”要认真调查研究，“求是”才能解决问题，实事求是的方法在于不断解放思想，解放思想的实质是厚今薄古，讲发展必须讲马克思主义中国化的其他成果，他们的历史使命已经完成，有益成分已经吸收到新思想中，讲思想武装与指导实践必须明确强调新思想。',1,16337106),(113,'2019-03-05 11:58:22.222864','第二十七讲：促进“一带一路”国际合作','方略论是新思想的主要内容，其他各讲共同构成方略论，其中包括理念论以及各方面建设内容，具体剖析如下。理念论除了新发展理念还包括全面深化改革、全面开放、法治国家，这些都具有指导思想的意义。值得注意的是，由全面扩大开放到形成全面开放新格局的提法是重要变化。',1,16337106),(114,'2019-03-05 20:10:07.445075','习近平：在新的起点上深化国家监察体制改革','党的十八大以来对国家监察体制进行了改革，党对反腐败工作的统一领导加群，进一步实现了对公权利监督的全覆盖，坚持了标本兼治，巩固扩大了反腐斗争成果。',1,16337112),(115,'2019-03-05 20:10:30.037055','习近平：加强党对全面依法治国的领导','党的十八大以来，提出一系列全面依法治国新理念新思想新战略，明确了全面依法治国的指导思想、发展道路、工作布局、重点任务，是马克思主义法治思想中国化的最新成果，是全面依法治国的根本遵循，必须长期坚持、不断丰富发展。',1,16337112),(116,'2019-03-05 20:11:38.892555','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','中国共产党人的初心和使命就是为中国人民谋幸福、为中国民族谋复兴。中国共产党是为人民谋利益的政党，具有统一的动员组织能力，积累了实现中华民族伟大复习的丰富经验，义务反顾肩负起中华民族伟大复兴的历史使命。我们也要为实现国家富强、民族振兴、人民幸福而努力奋斗。',1,16337112),(117,'2019-03-05 20:12:07.609672','第四讲：党和国家事业历史性、根本性的变革和成就','面对世界经济持续低迷，发展不均衡、不可持续问题突出，国内经济“三期叠加”，十八大以来党和国家事业进行了历史性变革，有效提高了国家机构依法履职能力，有效促进了社会公平正义，维护了人民群众合法权益，显著增强了党运用法律手段和治理国家的能力。',1,16337112),(118,'2019-03-05 22:34:45.790200','以精品奉献人民，用明德引领风尚','科技进步和创新是增强综合国力的决定性因素，世界范围内的竞争、综合国力的竞争，关键是科学技术的竞争，教育是培养人才的基础，对经济和发展具有先导性、全局性，增强创新能力关系到中华民族的兴衰存亡，创新是一个民族的灵魂，是一个国家兴旺发达的不竭动力。',1,17341117),(119,'2019-03-05 22:35:10.996409','【央视快评】与人民心心相印 与人民团结奋斗','中国人民的伟大团结精神是在历史继承中形成的，这种历史继承既包括对中国传统文化的继承，也包括对马克思主义和中国共产党在实践中形成的红色文化的传承。传承好伟大团结精神需要有伟大目标指引、伟大道路落实和伟大政党带领。发展好伟大精神要继续推动党的伟大团结、人民的伟大团结和民族的伟大团结。',1,17341117),(120,'2019-03-05 22:36:06.601614','为党和人民继续前进提供强大精神激励——全国政协文艺界社科界委员畅谈聆听习近平总书记讲话心得','文艺作品的创作与时代的发展息息相关，好的文艺作品能够代表一个时代的风貌，引领一个时代的风气，烙下时代的印记。文艺工作者应该铭记以人民为中心，创作接地气的好作品，真正用心弘扬中国特色社会主义新时代的伟大精神。',1,16337174),(121,'2019-03-05 22:36:18.519138','【央视快评】与人民心心相印 与人民团结奋斗','我们党一直强调人民当家做主，而党也始终坚持人民的主体地位，坚持为人民服务。过去的一年，十三届全国人大及其常委会，坚持党的领导，为人民认真履职，推进了社会各行各业的立法工作，密切联系群众，广纳群言，实现了良好开局。',1,16337174),(122,'2019-03-05 22:51:17.811035','听总书记讲新时代学雷锋','雷锋精神，人人可学；奉献爱心，处处可为。积小善为大善，善莫大焉。当有人需要帮助时，大家搭把手、出份力，社会将变得更加美好。这和我们党\"为人民服务’‘做人民勤务员’是一脉相承的，所以雷锋精神永远值得弘扬。',1,17341096),(124,'2019-03-06 00:03:41.748677','助推经济高质量发展 新型基建将是2019年投资重点','做好顶层设计和政策协调，避免出现盲目建设、重复建设甚至是恶性竞争的情况；要着力引入民间资本参与新型基础设施建设，形成多元化的投融资体系，并加快探索新型基础设施建设的商业可持续模式，做到风险可控。',1,17341096),(125,'2019-03-06 08:17:04.283660','图解|政府工作报告@所有人：2019年一起实现这些“小目标”！','3月5日国务院总理李克强代表国务院向十三届全国人大二次会议作政务工作报告，提出了对2019年的工作期望，并整理出了若干个小目标，对于普通人民群众而言以往许多国家发展目标是脱离生活的数据，此番将总目标拆分成若干个小目标，能更好的激发人们的积极性，增加工作效率',1,17341073),(126,'2019-03-06 09:14:41.163479','以精品奉献人民，用明德引领风尚','从习近平总书记提出的希望，我深刻的感悟到一个国家、一个民族不能没有灵魂。文化文艺工作、哲学社会科学工作就属于培根铸魂的工作，在党和国家全局工作中居于十分重要的地位，在新时代坚持和发展中国特色社会主义中具有十分重要的作用。总书记希望大家承担记录新时代、书写新时代、讴歌新时代的使命，勇于回答时代课题。这也是我们为之努力奋斗的目标。',1,17341074),(127,'2019-03-06 09:19:20.407150','【央视快评】与人民心心相印 与人民团结奋斗','全国人大代表大会观点提出要增强政治观念、法治观念、群众观念，履行宪法法律赋予的职责，发挥来自人民、植根人民的特点，接地气、察民情、聚民智，激扬人民情怀，反映人民心声。由衷提出必须坚持国家一切权力属于人民，坚持人民主体地位，支持和保证人民通过人民代表大会行使国家权力。要广纳群言，广谋良策，广聚共识，找到最大公约数，形成最大凝聚力。',1,17341074),(128,'2019-03-06 09:24:06.895767','第四讲：党和国家事业历史性、根本性的变革和成就','中国的发展经历了许多的困难与挫折，社会主义事业开展也面临过许多困难。但是，党和人民群众从未轻言放弃。在确立了中国特色社会主义路线后，在纠正了一些错误后，中国的发展令世人震惊。航空，海洋，农业，信息业，中国发挥着越来越重要的作用，经济影响力影响国际。我相信，中华复兴指日可待！',1,17341097),(129,'2019-03-06 10:16:41.382261','以精品奉献人民，用明德引领风尚','一个国家、一个民族不能没有灵魂。文化文艺工作、哲学社会科学工作就属于培根铸魂的工作，在党和国家全局工作中居于十分重要的地位，在新时代坚持和发展中国特色社会主义中具有十分重要的作用。',1,17341099),(130,'2019-03-06 11:41:06.986759','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','实现两个一百年目标，是中国的发展的目标，是社会主义建设进程中的关键步伐。新时代中国的发展要多元，经济，政治，文化，科技等等多个领域一起发展，要有伟大事件，敢于拼搏。如今，全面建成小康社会的关键目标正在实现，我们要拼搏，要努力，要有中国梦，不畏一切昂首向前！',1,17341097),(131,'2019-03-06 12:53:11.657304','习近平总书记在参加内蒙古代表团审议时的重要讲话产生热烈反响','总书记在参加内蒙古代表团审议时强调，要保持加强生态文明建设的战略定力，探索以生态优先，绿色发展为导向的高质量发展新路子，加大生态系统保护力度，打好污染防治攻坚战。这表明生态文明建设在新时代党和国家事业发展中的地位，这也需要我们大学生贡献自己的力量。',1,18340069),(132,'2019-03-06 13:30:52.280102','人民日报评论：以生态优先、绿色发展为导向','绿水青山也是金山银山。环境就是民生，过去的数十年间，秉承生态优先，我们国家从万里飞沙的沙漠逐步演变为如今的绿色奇迹，这需要我们继续坚持下去，我们也应从每个人做起，保护生态环境\n',1,16337171),(133,'2019-03-06 13:31:35.831482','人民日报评论：坚持知行合一 主动担当作为','空谈误国，实干兴邦。习总书记在会上强调了做实干家的重要性。在日常的学习和生活中，我们也需要主动的担当作为，要持续不停的奋斗，这是我们所需要注意的。',1,16337171),(134,'2019-03-06 13:35:25.551282','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','习近平新时代中国特色社会主义思想是我国发展的新历史方位，如今我们的社会主要矛盾发生了变化，我们的经济高速增长，我们有了新的奋斗目标，我们在国际舞台也扮演了越来越重要的角色。然而现在世界形势依旧是严峻的充满挑战的，在当下时代背景下孕育的习近平新时代中国特色社会主义理论，可以指导我们更好的开辟光明的未来,我们要坚定不移的坚持中国特色社会主义',1,16337171),(135,'2019-03-06 13:36:08.305868','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','中国特色社会主义是党和人民付出各种代价取得的宝贵成果，具有非常重大的历史意义。我们要注重五位一体的格局，坚持中国特色社会主义的道路，继续构筑中国精神、中国价值、中国力量。只有坚持中国特色社会主义才能实现中华民族的伟大复兴。',1,16337171),(136,'2019-03-06 14:41:46.999894','9图带你看习近平参加内蒙古代表团审议讲话金句','习近平主席参加内蒙古代表团审议讲话中，提到的重中之重便是继续加强环境保护和环境建设，绝对不能，不允许以发展经济而破坏环境为代价！绿水青山就是金山银山！！曾经中国的西北漫天黄沙，而如今，一片片绿色奇军在大漠之央。北方的环境越来越美好。相信坚持习近平的领导，祖国会越来越美',1,18340060),(137,'2019-03-06 20:57:39.097548','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','新民主主义革命中，打败了日本帝国主义，推翻国民党反动统治，完成新民主主义革命，建立了中华人民共和国。社会主义革命和社会主义建设，确立了社会主义基本制度，消灭了一切剥削制度，推进了社会主义建设。改革开放新的伟大革命，极大激发了广大人民群众的创造性，极大解放和发展了社会生产力，极大增强了社会发展活力，人民生活显著改善，综合国力显著增强，国际地位显著提高。中国梦的本质是国家富强、民族振兴、人民幸福。实现中华民族伟大复兴需要每一个人付出艰苦努力，担负自己的责任。',1,16337191),(138,'2019-03-06 21:18:25.962842','第二十二讲：建设美丽中国','这一讲集中体现了我国在推进生态文明建设的决心之大、力度之强、成效之显著。\"绿水青山就是金山银山。\"\"在发展中保护，在保护中发展。\"我们是这个讲的，也是这么做的:雄安新区规划高铁站时对白洋淀的避让就是最好的例子。前段时间NASA的卫星发现中国近二十年来新增的植被占全球新增绿色面积的四分之一，就是中国绿色发展的践行成效。',1,18340075),(139,'2019-03-06 21:19:20.503041','第四讲：党和国家事业历史性、根本性的变革和成就','十八大以来，全党全国的发展观念发生深刻变化，推动我国经济由高速增长阶段转向高质量发展阶段。中国特色社会主义法治体系日益完善。倡导“绿水青山就是金山银山”，强调“要像保护眼睛一样保护生态环境”，显著增强了全党全国贯彻绿色发展理念的自觉性和主动性。坚持统筹国内国际两个大局，推进全方位外交，提出构建人类命运共同体，形成了全方位、多层次、立体化的中国特色大国外交布局。这些历史性的改革最根本、最重要的在于有习近平新时代中国特色社会主义思想的科学指引，有以习近平同志为核心的党中央的坚强领导。',1,16337191),(140,'2019-03-06 21:25:06.677575','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','在实现中华民族伟大复兴的路上，中国很好的诠释了\"穷则独善其身，达则兼济天下\"这句古话。习主席曾说过，中国永远不称霸。我认为中国的复兴理念蕴含追求和平与共同发展两点。中国不干涉他国内政，是追求和平的重要体现;中国在多次国际会议中释放共同发展的信息:一带一路与人类命运共同体。毋庸置疑，这样的祖国，颇具大国风范。',1,18340075),(141,'2019-03-06 21:47:37.873643','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','标示我国发展新历史方位的新时代是在党和国家事业历史性、根本性变革和成就的基础上开辟的。新时代是中华民族伟大复兴的新台阶，进入新时代的根本原因在于坚持和发展了中国特色社会主义。',1,16337106),(142,'2019-03-06 21:47:58.473625','第四讲：党和国家事业历史性、根本性的变革和成就','关于主要矛盾的论述可以进一步深化。如果社会主要矛盾没有变化，新时代就是缺乏依据的。我们对社会主要矛盾的认识应该深入到具体分析其主要方面，主要矛盾的主要方面是可以发生阶段性变化的。当前主要矛盾的主要方面可以说是日益增长的物质财富同较大的分配差距之间的矛盾。',1,16337106),(143,'2019-03-06 22:15:56.779240','习近平总书记在参加内蒙古代表团审议时的重要讲话产生热烈反响','党的十八大提出了创造性提出了“五位一体”总体布局，党的十九大明确以“五位一体”的总体布局推进中国特色社会主义事业，经济、政治、文化、社会、生态文明五个方面是一个有机整体。生态文明建设是基础，要放在突出地位，具有重大现实意义和深远历史意义。',1,16337174),(144,'2019-03-06 22:44:24.395915','教育部部长就“学术不端”作出回应：坚决不允许','要充分尊重和信任科研人员，赋予创新团队和领军人才更大的人财物支配权和技术路线决策权。要大力简除烦苛，使科研人员潜心向学、创新突破。加强科研伦理和学风建设，惩戒学术不端，力戒浮躁之风。',1,17341096),(145,'2019-03-06 22:47:01.239363','起草组负责人解读政府工作报告：“改革”出现105次为历年之最','改革开放是决定当代中国命运的关键一招，也是实现“两个一百年”奋斗目标的关键一招。前瞻未来，必须以更大的力度推进改革，进一步着力优化营商环境，进一步激发市场活力和社会创造力，培育新动能，推动经济高质量发展。',1,17341096),(146,'2019-03-06 22:57:22.846066','政协委员在全国政协十三届二次会议记者会上谈“打赢三大攻坚战”','要实现精准扶贫，就要确保扶贫资金的每一分钱都用在贫困群众身上，特别是要关注产业扶贫、教育扶贫、生态扶贫、移民搬迁和社保兜底这些政策在基层落实的精准情况，确保能够精准脱贫。扶贫资金来之不易，每一分钱都要精打细算，要用好、用活、用出成效，特别是要让每一笔扶贫资金的效益最大化。',1,17341099),(147,'2019-03-06 23:04:49.736659','养老机构等级国家标准出台：养老院将有“五星级”','养老机构的服务质量直接关系到入住老年人的切身利益、养老机构的生存与发展、社会对政府监管工作的满意度，养老机构等级国家标准的出台有利于养老服务质量的提高。',1,16337112),(148,'2019-03-06 23:05:49.361050','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','中国特色社会主义进入新时代是我国发展新的历史方位，这一政治论断是在党科学把握时代趋势、国际局势、世情国情党情深刻变化的基础上作出的，这要求我们以新思想为科学指引、进行新的伟大实践、有新的理念举措和精神风貌。',1,16337112),(149,'2019-03-06 23:06:11.160203','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','我国社会主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾。满足人民对美好生活的需要要调整和完善发展策略、各项政策，坚持在发展中保障和改善民生，不断促进社会公平正义，使人民更有获得感、幸福感、安全感。',1,16337112),(150,'2019-03-06 23:32:48.833220','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','改革开放以来的四十年间，中国发展十分迅速，实现了经济，文化等多个领域的飞跃。实现了两个两百年的目标，我们充满相信。而今，全面建成小康社会目标已然近在咫尺，为确保经济的稳健发展，我们依旧不能松懈。改善民生，改善医疗、教育条件等等依旧是重要的发力点，我们有信心做好这些，中国的未来不可估量。',1,17341097),(151,'2019-03-07 13:14:05.417521','多地为污染防治划重点 大气污染防治仍是重中之重','多地为污染防治划重点，在当今社会，保护环境就是保护和发展生产力，实践证明环境好能够增加投资吸引力等，因此，在发展经济的同时我们绝不能以破坏环境为代价，要时刻把污染防治放在突出地位',1,17341073),(152,'2019-03-07 13:15:01.633748','今年国办派出180多人旁听全国两会 服务科学决策','为政之道，以顺民心为本。正如王冰峰旁听多场讨论后在笔记本上写下的体会：“走出办公室亲耳聆听代表委员的意见建议，我感到有利于牢固树立民之所望、施政所向的意识，有利于做好政策文件的审核把关，有利于发现政府乃至自己个人在工作中存在的不足',1,17341114),(153,'2019-03-07 13:15:15.799923','改善营商环境给企业家吃了“定心丸”','优化营商环境，就是解放生产力，就是提高综合竞争力，这是一个地方也是一个国家发展的重要软实力。“政府要严守承诺，不能新官不理旧账、对企业不公平对待或搞地方保护”；“保障不同所有制企业在资质许可、政府采购、科技项目、标准制定等方面公平待遇，坚决查处滥用行政权力排除和限制竞争的行为”；“一定要让我们的企业家、市场主体真正感觉到营商环境的切实优化”；要让中国成为世界上的最佳投资地…',1,17341114),(154,'2019-03-07 13:16:05.588888','代表委员审议讨论政府工作报告：以改革激发活力 用创新引领发展','创新是第一动力。改革是活力之源，创新是第一动力，奋斗创造历史，实干成就未来。我们在创业创新历程中更加深刻体会到，创新驱动已成为推动高质量发展的战略支撑。国家强盛离不开科技的振兴，关键领域核心技术必须要攻关、突破。',1,17341074),(155,'2019-03-07 13:16:16.635450','全国政协委员移动履职平台展现新气象：建言资政时刻在线','人民政协不断创新履职方式，让政协委员思想永远在线、智慧时刻连线、联系永不断线。网络议政是开门办事，非常了不起。我们只有会上会下广纳群言，线上线下同步讨论。画好网上网下最大同心圆，为党和国家工作大局作出更大贡献。',1,17341074),(156,'2019-03-07 13:17:13.673654','从全国两会看奋进中国的坚定步伐','开拓更加宽广的高质量发展前景，全国两会展现奋进中国的坚定步伐。抓住重要战略机遇期，顺应时代大势，沿着高质量发展道路坚定前行。迎难而上，开拓进取，中国经济高质量发展的大道必将愈走愈宽。',1,18340076),(157,'2019-03-07 13:17:26.165968','大幅减税降费带给青年更多红利','在产业转型升级的关键时期，政府工作报告提出全年减轻企业税收和社保缴费负担近2万亿元的目标，并重点提及针对制造业、交通运输业的减税方向，这不仅坚定了企业家的信心，也有利于提升我国对国际高端专业人才的吸引力，增强国际竞争力。',1,18340076),(158,'2019-03-07 13:17:57.622151','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','满足人民对美好生活的需要要调整和完善发展策略、各项政策，坚持在发展中保障和改善民生，不断促进社会公平正义，使人民更有获得感、幸福感、安全感。',1,16337106),(160,'2019-03-07 13:20:19.757782','从全国两会看奋进中国的坚定步伐','抓住重要战略机遇期，顺应时代大势，沿着高质量发展道路坚定前行，中国经济必将开拓更加宽广的发展空间。牢牢把握发展主动权，直面跨越发展关口的问题和挑战，把握时与势激发发展潜力和空间，是发展的应有之义。',1,18340069),(163,'2019-03-07 19:10:22.179103','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','自1840年鸦片战争以来的百年，中国备受压迫，1949年新中国成立，一直到了1978年改革开放后人民的生活才真正意义上好起来了，但这些都远远不够，中国几千年的历史一直是世界的强国，而今天的我们的国家也同样能成为世界强国，实现中华民族伟大复兴是近代以来中华民族最伟大的梦想。',1,15336121),(164,'2019-03-07 19:14:10.681382','第四讲：党和国家事业历史性、根本性的变革和成就','党和国家事业发生历史性变革、取得历史性成就的原因，是全党全国各族人民同心同德、团结奋斗的结果；是各级党组织和广大党员、干部敬业履职、勇于担当的结果；最根本、最重要的在于有习近平新时代中国特色社会主义思想的科学指引，有以习近平同志为核心的党中央的坚强领导。',1,15336121),(165,'2019-03-07 20:51:01.440822','每日金句|习近平论自由贸易试验区建设','中国如今正致力于自由贸易区的建设，自由贸易试验区建设的核心任务是制度创新。这就需要我们突破瓶颈、疏通堵点、激活全盘。坚持建设公平、统一、高效的市场环境。让中国形成法治化、国际化、便利化的营商环境',1,18340060),(166,'2019-03-07 22:28:02.983986','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','实现中华民族伟大复兴是我们几代中国人的夙愿。从古代的繁荣发达到近代的衰败，我们走过了十分漫长的岁月。如今，我党肩负起了实现中国梦的使命，从革命的成功，到改革开放的历史性创举，未来在我党的带领下，中国梦必然可以实现。',1,16337171),(167,'2019-03-07 22:28:21.955682','第四讲：党和国家事业历史性、根本性的变革和成就','13万公里的公路，2万公里的高铁，4000公里的城市轨道交通，短短的几十年，我国就有了翻天覆地的变化，这些历史性的变革给人民带来了如今幸福的生活，我们可以看到，东方大国正在朝气蓬勃的发展，并将取得更辉煌的历史性成就',1,16337171),(168,'2019-03-07 23:21:44.284042','习近平参加内蒙古代表团审议','生态文明建设是“五位一体”总体布局中的一位。我国现在非常重视绿色发展，而内蒙古大草原对我们国家而言是一道非常重要的绿色屏障，我们必须保持加强生态文明建设的战略定力',1,16337171),(169,'2019-03-07 23:21:51.847654','习近平：脱贫攻坚要响鼓重锤','艰苦奋斗、勤俭节约，不仅是我们一路走来、发展壮大的重要保证，也是我们继往开来、再创辉煌的重要保证。不要搞“大跃进”“浮夸风”，不要搞急功近利、虚假政绩的东西，对这类问题现在就要敲打，防患未然，防微杜渐。',1,17341096),(170,'2019-03-07 23:22:04.121224','习近平等党和国家领导人出席十三届全国人大二次会议开幕会','3月，新一届的人民代表大会开幕了，过去一年，我国在全面建成小康社会上又取得了重大进展，形势喜人，同时，如李克强总理所说，我们也需要居安思危，继续砥砺前行，奋勇前进',1,16337171),(171,'2019-03-07 23:25:50.043410','每日金句|习近平论自由贸易试验区建设','深化完善基本体系，突破瓶颈、疏通堵点、激活全盘，创新建设好试验区。加快建立同国际投资和贸易通行规则相衔接的制度体系，形成法治化、国际化、便利化的营商环境，加快形成公平、统一、高效的市场环境。',1,17341096),(172,'2019-03-07 23:41:56.563453','第七讲：坚持党对一切工作的领导','马克思主义是时代的产物,马克思主义正是适应了时代和实践的需要而产生的无产阶级的科学理论。祖国的发展得益于党的不断发展，正是由于指导思想的正确,中国才能不迷失方向。因此，拥护中国共产党，不动摇决心，我们能越走越好！相信党，相信人民，相信自己！',1,17341097),(173,'2019-03-07 23:45:39.750559','第八讲：以人民为中心是新时代坚持和发展中国特色社会主义根本立场','人民群众是最最重要的。为人民服务是党的重要思想，每个党员都应该时刻牢记市民，献身社会主义事业，为人民作出奉献。水能载舟亦能覆舟，只有好好为人民服务，听取群众意见，凝结群众意识，中国才能愈发强大。中华历史文化博大精深，中华民族是个伟大的集体，我们要相信，未来就在我们手中！',1,17341097),(174,'2019-03-07 23:51:58.459702','习近平：脱贫攻坚要响鼓重锤','党的十九大报告明确提出了乡村振兴战略，这是“五位一体”总体布局在乡村领域的具体落实，也是社会主义新农村建设在内涵与外延上的重大提升。乡村振兴的首要问题是更新观念，注重乡村的可持续发展，把农耕文明的精华和现代文明的精华有机结合起来，使传统村落、自然风貌、文化保护和生态宜居诸多因素有机结合在一起，充分体现农村社会主义精神文明',1,17341117),(175,'2019-03-07 23:53:05.418002','代表委员热议“三农”工作：聚力乡村振兴 实干创造幸福','在现阶段，只有实行统筹城乡经济社会发展的方略，才能切实优化经济结构和实现协调的、可持续的发展，才能使广大人民群众共享经济社会发展的成果，才能如期实现全面建设小康社会和现代化的宏伟目标。取消农业税，绝不仅仅是为了农业、农村的发展和农民的富裕，而是关系到实现国家的长治久安和民族的伟大复兴。',1,17341117),(176,'2019-03-08 15:27:15.095250','“国家账本”传递2019年国计民生十大信号','3月5日，十三届全国人大二次会议开始审查预算报告，这份预算报告传递出了大量的信息，涉及到多个方面，其中比较贴近我们的莫过于减少税收以增加市场主体活力，补助资金增长以促进创新创业，养老金标准提高等。从中可以看出我国政府为人民服务、为人民谋福利的决心，给了我们莫大的鼓励',1,17341073),(177,'2019-03-08 15:27:53.831609','尽锐出战 迎难而上 确保脱贫攻坚如期完成','总书记脱贫攻坚的宣言书、动员令，必将激励我们尽锐出战、迎难而上，真抓实干、精准施策，确保脱贫攻坚任务如期完成。我们要拿出“不获全胜、决不收兵”的豪情壮志，咬定青山不放松，以愚公之志苦干实干，彻底打赢这场攻坚战，为全面建成小康社会提供坚强保障。',1,17341074),(178,'2019-03-08 15:28:05.487735','《求是》杂志发表习近平总书记重要文章 《在新的起点上深化国家监察体制改革》','建设法制国家就要规范和正确行使国家监察权。纪检监察机关肩负着党和人民重托，必须牢记打铁必须自身硬的政治要求。众所周知，权力监督的目的是保证公权力正确行使，才更好促进干部履职尽责、干事创业。俗话说:打铁必须自身硬。这正是我们要明白的道理。',1,17341074),(179,'2019-03-08 15:28:46.342014','每日金句|习近平论党的妇女工作','把握实现中华民族伟大复兴的中国梦这一当代中国妇女运动的时代主题，促进男女平等，加强党对妇女工作的领导，组织促进妇女走在时代前列，在改革开放一线建功立业。',1,18340069),(180,'2019-03-08 16:16:25.396431','第九讲：将全面深化改革进行到底','自从改革开放以来，中国发生了翻天覆地的变化，国际影响力也大幅提升。走特色开放的路，才是走向未来的明智之举。因此，全面深化改革，是重中之重。而在深化改革的道路上，我们更要牢牢把握住正确的方向，走中国特色社会主义的道路。从多个层面出发，让制度更合理，让改革更全身深入。',1,17341097),(182,'2019-03-08 19:47:41.054400','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','',0,16337106),(183,'2019-03-08 21:34:46.911401','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','经过改革开放40年努力，我国稳定解决了十几亿人的温饱问题，总体上实现了小康，不久将全面建成小康社会，人民美好生活需要日益广泛。发展不平衡和不充分已经成为满足人民美好生活需要的主要制约因素，比如我国西部地区的发展远落后于沿海地带。当代中国已不再是国际秩序的被动接受者，而是积极的参与者、建设者、引领者。在中国特色社会主义新时代，我们党面临的“四大考验”和“四种危险”仍然是长期的、复杂的、尖锐的、严峻的，全面从严治党永远在路上。新时代，继续奋斗。',1,16337191),(184,'2019-03-08 21:56:57.561587','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','改革开放以来，我国人民生活水平不断迈上新台阶，人均国内生产总值年均增长约9.5%，已经达到中等偏上收入国家水平。人民美好生活需要日益广泛，不仅对物质文化生活提出了更高要求，而且在民主、法治、公平、正义、安全、环境等方面的要求日益增长。我国社会主要矛盾发生变化，从解决“落后的社会生产”问题到解决“不平衡不充分的发展”问题，但需要认识到我国仍处于并将长期处于社会主义初级阶段没有变，既不落后于时代，也不能脱离实际、超越阶段，这样才能更好发展中国特色社会主义事业。',1,16337191),(185,'2019-03-08 23:06:31.346526','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','实现中华民族伟大复兴是近代以来中华民族最伟大的梦想，从封建社会到资本主义社会，我们经历了很多兴衰。然而中国近现代，是靠中国共产党中国人民才真正站起来了，做自己的主人。中国共产党义无反顾的肩负起实现中华民族伟大复兴历史使命，不忘初心，砥砺前行。改革开放以来，我国实现了巨大的进步。未来我们一定可以实现实现中华民族伟大复兴！',1,17341105),(186,'2019-03-08 23:12:28.199437','每日金句|习近平论党的妇女工作','把握实现中华民族伟大复兴的中国梦是我们这一中国妇女运动的时代主题，促进男女平等，发挥妇女在各个方面的积极作用才能更好促进社会发展',1,17341096),(187,'2019-03-08 23:14:07.110129','第四讲：党和国家事业历史性、根本性的变革和成就','当合国家事业历史性，根本性的变革和成就我们有目共睹，从刚健国时候的一穷二白，到现在的丰衣足食，当合国家取得了突出的成就。从土地改革，到解放西藏，从一五计划，到改革开放，我国经济不断发展，人民生活水平也迅速提高。同时，党和国家还积极治理环境，提出绿水青山就是金山银山，冰天雪地也是金山银山的环保观点。而且，党和国家积极推进科教兴国，人才强国战略，在教育科研上的投资年年增加。这些成就都是有目共睹的，我们也不应故步自封，要争取早日实现全面小康社会',1,17341105),(188,'2019-03-08 23:14:53.629460','央视快评：尽锐出战 迎难而上 确保脱贫攻坚如期完成','脱贫攻坚，必须从严从实，来不得半点形式主义、官僚主义。我们要尽锐出战，迎难而上，确保脱贫攻坚如期完成，为全面建设，脱贫攻坚再加油！在脱贫标准上，既不能脱离实际、拔高标准、吊高胃口，也不能虚假脱贫、降低标准、影响成色。',1,17341096),(189,'2019-03-08 23:22:09.831371','这项工作越到最后时刻越要响鼓重锤','扶贫开发攻坚是实现共同富裕的需要，是社会主义的本质要求。民生导向、共同富裕代表着中国未来的发展方向，是中国共产党不懈追求的终极目标。社会主义的本质是解放生产力，发展生产力，消灭剥削，消除两极分化，最终达到共同富裕。共同富裕的主体是全体中国人民。所以，消除贫困，共同富裕，不仅关系到经济又好又快发展问题，而且关系到全体人民对社会主义制度的信仰问题。',1,17341117),(190,'2019-03-08 23:23:04.524881','广西：减税降费政策“组合拳”助力企业发展','实行结构性减税，结合推进税制改革，用减税、退税或抵免的方式减轻税收负担，促进企业投资和居民消费，是实行积极财政政策的重要内容。增值税转型改革，是我国历史上单项税制改革减税力度最大的一次。此举可有效避免企业设备购置的重复征税，有利于促进企业技术进步、产业结构调整和经济增长方式的转变',1,17341117),(191,'2019-03-08 23:24:49.055304','两会经济观察：扩大对外开放 优化营商环境','开放是一件件身边小事，更是经济发展大事。扩大开放有利于营造更公平的竞争环境，中国用实践证明，开放是推进改革的重要手段。这不仅，提升居民生活质量、助力经济发展，也是全世界的发展机遇。',1,18340076),(192,'2019-03-08 23:25:51.739076','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','经过近代以来的磨难，中华民族已经迎来了从站起来、富起来到强起来的伟大飞跃。社会主义在我国展现出了强大的生命力。如今是中国特色社会主义的新时代，在新时代下我们也要有新气象，新作为，努力朝第二个百年目标奋斗。要有更高的境界，更强的本领，更优的作风，更好的精神状态，不断把中国特色社会主义推向前进',1,16337171),(193,'2019-03-08 23:30:07.499132','每日金句|习近平论党的妇女工作','新时代下，要加强党对妇女的领导工作，促进男女平等，积极发挥妇女在各个行业的积极作用，优势体现，组织妇女走上时代的前列',1,16337171),(194,'2019-03-08 23:33:25.896792','这项工作越到最后时刻越要响鼓重锤','党和政府非常重视扶贫开发工作，牵挂处在贫困地区的人民，给予更多的帮助和支持。在这样的牵挂和人民的努力下，脱贫攻坚战必然可以打好，祖国必然繁荣昌盛',1,16337171),(195,'2019-03-08 23:35:20.010686','第八讲：以人民为中心是新时代坚持和发展中国特色社会主义根本立场','为人民服务，这是党在革命时期开始就践行的准则。从以前的“不拿群众一针一线”到现在的“以人民为中心”，无不诠释了党对人民的高度关注。人民是党的寄托和牵挂，这样时常把人民挂在嘴边的党，无疑是最受群众欢迎的。近年来，习近平多次深入农村，与群众打成一片，是党对人民牵挂的最佳诠释。有这样的主席，有这样的党，中国人民一定有更美好的生活。',1,18340075),(196,'2019-03-08 23:40:31.777974','每日金句|习近平论党的妇女工作','要加强党对妇女工作的领导，坚持中国特色社会主义妇女发展道路，把握实现中华民族伟大复兴的中国梦这一当代中国妇女运动的时代主题，促进男女平等，发挥妇女在各个方面的积极作用，组织动员妇女走在时代前列，在改革发展稳定第一线建功立业。',1,17341114),(197,'2019-03-08 23:47:38.883653','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','2017年的党代表大会上，习总书记提出，我国社会主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分发展之间的矛盾。这是通过历史和现实，理论和实践相结合的分析得出的正确结论，反映了我国社会发展的客观实际',1,16337171),(198,'2019-03-08 23:47:43.813588','第十一讲：决胜全面建成小康社会','决胜全面建成小康社会，是建党100年奋斗的目标。到2020年，我国将全面建成小康社会，扶贫攻坚任务繁重。减少贫困人口数量，不仅体现党“以人民为中心”的理念，更体现社会主义制度的优势。相信在国家、企业、基层干部的支持下，全面小康的道路一定越拓越宽，中国迈向社会主义强国的步子一定越走越大。',1,18340075),(199,'2019-03-08 23:56:44.306321','《流浪地球》来到“学习强国”','',0,17341114),(200,'2019-03-09 00:04:18.277054','这项工作越到最后时刻越要响鼓重锤','习近平总书记参加甘肃代表团审议，着重考察了扶贫工作，强调越到最后时刻越不能落下扶贫工作的开展。要实现我国全面建成小康社会的目标，就一定要实现精准扶贫，一个也不落下，脱贫攻坚，要坚定信心不动摇',1,17341073),(201,'2019-03-09 16:47:20.704405','施一公：中国未来教育目标应培育富有社会责任感的拔尖创新人才','我国在基础研究领域跟西方国家还有很大的差距，还需要更多原创性突破，我国原创性这方面的研究还不能够完全满足社会经济发展的需求。虽然现在我们国家的专利远远多于别的国家，但是普遍质量不高，没有实际意义。尖端核心的技术是买不来的，必须也只能靠我们自己去创造。未来社会更需要的是有责任感，有想法，敢作敢当，有创造力的拔尖创新人才!',1,17341095),(202,'2019-03-09 21:27:11.365248','每日金句|习近平论营造风清气正的政治生态','廉政建设，是党执政建设的形象，关系着党和国家的生死存亡，关系着人心向背。因此，在新时期，加强和改进党的廉政建设，是全面贯彻党的基本理论、基本纲领和实践“三个代表”重要思想的迫切需要，是改革开放和现代化建设新局面的必然要求，是使党永远立于不败之地的重要保证。',1,17341117),(203,'2019-03-09 21:28:21.162383','青年大学习·两会时刻：农村发展大有可为','村振兴是解决中国发展不平衡、不充分的关键。乡村振兴的要害在乡村以外，振兴要放在城市化的背景下，必须按照城乡一体、城乡互动的新型城市化战略来引领，建立城镇对农村的协作和援助机制，推动资源要素向农村转移配置。此外，城镇基础设施建设和公共服务也需向农村和农民延伸。',1,17341117),(204,'2019-03-09 21:40:56.628659','青年大学习·两会时刻：农村发展大有可为','我国是农业大国，重农固本是安民之基、治国之要。新农村建设一定要走符合农村实际的路子，遵循乡村自身发展规律，充分体现农村特点，注意乡土味道，保留乡',1,17341099),(205,'2019-03-09 21:41:46.902732','第十七讲：加快建设社会主义法治国家','健全法制，建立社会主义法制国家，是迈向社会主义强国的必由之路。没有法制，社会就没有秩序;执法不到位，法制就是一纸空文。首先要完善法律法规，其次落实到位。腐败是导致有制度而无落实的重要原因，国家重拳反腐，不仅是严肃党风的要求，也是法制建设的必然要求。相信随着法制的进一步完善，我们的社会将更加和谐、稳定。',1,18340075),(206,'2019-03-09 21:53:04.301989','【一枝一叶总关情】习近平心系中原','3月8日，习近平总书记访问河南省。秉承着实现‘两个一百年’奋斗目标、实现中华民族伟大复兴的中国梦需要中原更加出彩的理念。习总书记认真考察了当地的农业发展，并且给予了充分的肯定。同时习总书记还提出了“四张牌”，把准发展脉搏的理念相信会为以后的发展带来更大的帮助',1,18340060),(207,'2019-03-09 21:59:55.822161','第二十六讲：构建人类命运共同体','人类命运共同体，是中国发出的时代和平之音。这个友好的声音彰显了我国永远不称霸的理念，彰显了我国与世界共同发展的期待，彰显了我国的大国风范。中国在国际会议上的声音越来越得到他国的认可，说明中国的国际地位得到提高，国际社会越来越期待听到中国声音，听到中国方案。',1,18340075),(208,'2019-03-09 22:03:43.716939','海外专家学者高度评价中国外交理念和外交成就','海外专家学者高度评价中国外交理念和外交成就，认为中国为世界和平发展作出了卓越的贡献。中国遵守互利共赢、天下为公、独立自主的准则。作为东亚大国，中国在促进各国化分歧为合作方面发挥了重要作用。',1,18340076),(209,'2019-03-09 22:08:23.054884','从全国人大常委会工作报告看新时代人大工作的责任担当','一年来，十三届全国人大常委会依法履职，开拓进取，实现了良好开局。不仅提供法治保障，服务改革发展稳定大局，还敢于动真碰硬，监督工作出实招见实效，更加强自身建设，持续焕发制度生机。使人民代表大会制度的优越性进一步彰显。',1,18340076),(210,'2019-03-09 22:37:31.845159','习近平参加河南代表团审议讲话金句','乡村振兴的主要方向是农业。农业关乎村民的产业和农村的生态，其首要任务是确保粮食供给，基本手段为保护耕地，具体操作是完善体制。同时，为了达到文化建设和人才建设的目的，地方政府需要在基础设施和文明教育上双管齐下，在产业发展和脱贫攻坚上两面开花。产业发展的要义是开源，脱贫攻坚的要义是精准，因此，需要从源头和供给方面双管齐下。',1,18340069),(211,'2019-03-09 23:06:45.531607','习近平等出席十三届全国人大二次会议第二次全体会议','坚持党的领导、人民当家作主、依法治国有机统一，保证党领导人民有效治理国家。高举中国特色社会主义伟大旗帜，坚持稳中求进工作总基调，贯彻新发展理念，着力提升立法、监督、代表工作、对外交往和自身建设水平，努力开创新时代人大工作新局面。认真学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神',1,17341096),(212,'2019-03-09 23:14:27.845722','习近平支持鼓励她们书写“美丽人生”','妇女是物质文明和精神文明的创造者，是推动社会发展和进步的重要力量。没有妇女，就没有人类，就没有社会。追求男女平等的事业是伟大的。没有妇女解放和进步，就没有人类解放和进步。毛主席一句时代不同了男女都一样，压在干古以来妇女肩上的枷锁解放了！妇女能顶半边天己不再是虚幻，女科学家，女干部，女劳模己不再鲜见，中国梦的实现离开妇女的力量，己不在可能!',1,17341096),(213,'2019-03-09 23:27:40.648126','习近平参加河南代表团审议讲话金句','乡村振兴是一场全面的振兴，包括产业，人才，文化生态等各个方面。中央时刻牵挂着贫困地区，相信在各级政府的努力下，我们一定可以按时按质完成脱贫攻坚任务',1,16337171),(214,'2019-03-09 23:28:01.057148','每日金句|习近平论营造风清气正的政治生态','政治生态清明，从政环境就清凉。近年来的反腐行动，我党取得了很大的进展。我们都应该从自己做起，立正身，讲原则，守纪律，拒绝腐蚀。',1,16337171),(215,'2019-03-09 23:38:30.841755','从区域协调发展看奋进中国的发展新空间','我国幅员辽阔，各地资源禀赋不同，如何发挥各地比较优势，形成优势互补首当其冲成为我国现阶段发展的重点难点。如今，共建\"一带一路\"，推动区域发展格局不断优化，不断增强区域发展协同性成为了时代的引领。正如总书记所说我们要打好攻坚战，做好打持久战的准备。',1,17341074),(216,'2019-03-09 23:40:57.814476','首批153名预算审查监督联系代表看紧政府钱袋子','设立全国人大预算审查监督联系代表，开展预算联网监督有利于推进人大预算审查监督工作创新。关键还是看支出，要看财政投入总量是增还是减，还要看增在哪个地方，减在哪个地方。我们老说好钢用在刀刃上，要发现刃口在哪个地方。经济管理，管控是必须的！',1,17341074),(217,'2019-03-09 23:48:33.037794','第七讲：坚持党对一切工作的领导','坚持党对一切工作的领导是由我们党的性质决定的，是历史和人民的选择，是实现中华民族伟大复兴的根本保证。我国是有着十几亿人口的大国，没有一个政党领导就会四分五裂。同时，我党也在历史的进程中，证明了自己是可以带领国家走上富强，带领人民走向幸福的政党。因此我们必须要坚持党对一切工作的领导',1,16337171),(218,'2019-03-09 23:49:03.523905','[面对面]任正非：时下的华为','正如任正非所提倡的那样，未来的长远的发展一定是建立在基础学科的发展上面的。现在我们国家经济的过快发展，使得出现了太多的泡沫。大家都想着怎么捞钱，真正做学问的少了！这些话我们都应该引以为鉴，我们要创造属于我们的价值！',1,17341095),(219,'2019-03-09 23:50:03.883120','第十讲：坚定不移贯彻新发展理念','现阶段，中国已经进入了发展的全新时期，特别是经济领域。特别是改革开放以来，中国发生了突飞猛进的发展。开放的观点最为重要，因此，我们必须坚持开放，贯彻新的理念。要把重点放在经济与民生等等角度上，只有这样，才能从根本上提高中国的综合国力。发展不能止步！',1,17341097),(220,'2019-03-09 23:51:16.209469','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','中国特色社会主义新时代表示我国发展新的历史方位，使命呼唤担当，使命引领信心，中国共产党坚定信心，奋发有为，让中国特色社会主义展示出了强大的生命力。我们的目标是，到21世纪中叶，全面建成富强民主文明和谐美丽的社会主义现代化强国，为了这个目标，我们要不懈努力',1,17341105),(221,'2019-03-09 23:52:15.138911','第二十六讲：构建人类命运共同体','构建人类命运共同体思想立足于摒弃你输我赢的旧观念，实现各国之间的有效融合与互动。在奉行和平发展、合作共赢原则的基础上，构建对话不对抗、结伴不结盟的伙伴关系，通过对内改革、对外开放，主动参与国际合作，顺应世界格局演变的趋势，维护世界和平。',1,16337106),(222,'2019-03-09 23:53:39.221664','第十讲：坚定不移贯彻新发展理念','创新、协调、绿色、开放、共享的新发 展理念不是凭空得来的，而是在深刻总 结国内外发展经验教训、分析国内外发 展大势的基础上形成的，也是针对我国 发展中的突出矛盾和问题提出来的。 新发展理念深刻揭示了实现更高质量、 更有效率、更加公平、更可持续发展的 必由之路，是引领我国发展全局深刻变 革的科学指引，对于进一步转变发展方 式、优化经济结构、转换增长动力，推动 我国经济实现高质量发展具有重大指 导意义。',1,16337106),(223,'2019-03-09 23:55:15.822494','第十一讲：决胜全面建成小康社会','实现两个一百年目标，是中国的发展的目标，是社会主义建设进程中的关键步伐。而实现这一宏伟目标，要从小步骤来。当前首要任务就是全面建成小康社会。中国特色社会主义的道路是发展的道路，坚持下去，实现中华民族伟大复兴指日可待。我相信，中国全面建成小康社会的任务，必能完成！',1,17341097),(224,'2019-03-09 23:56:03.386526','第八讲：以人民为中心是新时代坚持和发展中国特色社会主义根本立场','人民是历史的创造者，人民对美好生活的向往就是我们的奋斗目标。我党的初衷就是为人民谋幸福，从总书记到各级领导干部都非常挂念人民的生活。不忘初心，一切为了人民，全心全意为人民服务，发展最广大人民的根本利益。同时，我党也依靠人民创造历史伟业，在任何一项政策的制定上都要倾听群众的呼声。',1,16337171),(225,'2019-03-09 23:56:08.814801','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','我国社会主要矛盾的变化是关系全局的历史性变化，我国的主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾。从原来的落后生产，到现在的不平衡不充分的发展，说明我们已经取得了很大的突破，将生产发展起来。我们现阶段的主要任务，还是进一步解放生产力，发展生产力，逐步实现社会主义现代化，并且为此改善生产关系。这是历史性的转折，也标志着社会主义现代化离我们更近了一步',1,17341105),(226,'2019-03-10 17:08:51.167607','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','顺应时代潮流，把握时代特点，回答时代课题，是中国共产党永葆旺盛生命力和坚强战斗力、不断从胜利走向胜利的一个重要原因。具体问题具体分析，与时俱进，不断发展现有的理论成果，才能实现中国的稳定繁荣发展',1,15336121),(227,'2019-03-10 17:10:21.612396','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','社会主要矛盾状况及其变化是社会发展阶段性划分的重要依据。党的十九大提出，我国社会主要矛盾已经由人民日益增长的物质文化需要同落后的社会生产之间的矛盾，转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾。这个论断，反映了我国发展的实际状况，揭示了制约我国发展的症结所在，指明了解决当代中国发展主要问题的根本着力点。',1,15336121),(228,'2019-03-10 17:40:04.561883','第二十八讲：毫不动摇把党建设得更加坚强有力','党和人民事业发展到什么阶段，党的建设就要推进到什么阶段。这是加强党的建设必须把握的基本规律。全面从严治党永远在路上。我们要以习近平新时代中国特色社会主义思想为指导，总结党的十八大以来党建实践的历史性成就和党建理论的重大创新，总结党的建设的基本经验和管党治党的基本规律，开创全面从严治党新局面，不断提高党的执政能力和领导水平，确保我们党永葆旺盛生命力和强大战斗力。',1,17341074),(229,'2019-03-10 17:42:12.125104','第二十三讲：坚持总体国家安全观','习近平总书记强调，要准确把握国家安全形势变化新特点新趋势，坚持总体国家安全观，走出一条中国特色国家安全道路。 习近平指出，增强忧患意识，做到居安思危，是我们治党治国必须始终坚持的一个重大原则。 我们党要巩固执政地位，要团结带领人民坚持和发展中国特色社会主义，保证国家安全是头等大事。 当前我国国家安全内涵和外延比历史上任何时候都要丰富，时空领域比历史上任何时候都要宽广，内外因素比历史上任何时候都要复杂，必须坚持总体国家安全观',1,17341074),(230,'2019-03-10 18:57:54.159482','第十一讲：决胜全面建成小康社会','党的十九大报告明确了新时代的基本方略、奋斗目标、战略安排和工作布局，是我们党在新时代坚持和发展中国特色社会主义的政治宣言和行动纲领。作为当下首要的政治任务，学习贯彻党的十九大精神，“一把手”要起表率带头作用，学思在前，践悟在前。',1,16337106),(231,'2019-03-10 18:58:58.602540',NULL,'中央全面依法治国委员会的组建和依法治国委员会两次会议的召开,使法治中国建设迈入系统推进的新阶段,依法治国委员会确定的年度工作任务基本完成,宪法学习宣传教育落点实、效果好,一批涉及高质量发展、保障和改善民生的重要法律法规陆续出台,法治政府建设扎实推进,司法体制改革蹄疾步稳,法治社会建设全面深化,全面依法治国迈出新步伐。',0,16337106),(232,'2019-03-10 21:56:52.979653','向总书记汇报，大凉山传来好消息','精准扶贫是一项艰难的工作，教育和经济两头抓。尽管还有很多堡垒需要攻克，但是时刻有着国家的关怀和党员干部的帮助，贫困人民在小康路上绝不会掉队！四川相对落后的大凉山，甘孜州，阿坝州一定会发展得越来越好!',1,17341095),(233,'2019-03-10 22:14:16.725816','墨梅','蒙曼老师讲了中国诗词中重要的四个意向孝悌忠信，礼义廉耻，梅兰竹菊，风花雪月都源于我国优秀的传统文化。孝悌忠信礼义廉耻源自中国文化的基本价值观；梅兰竹菊是花的四君子，品行高洁。我们要大力继承我国优秀的传统文化。',1,17341095),(234,'2019-03-10 22:25:23.790125','每日金句|习近平论政德','习近平总书记在十三届全国人大一次会议重庆代表团审议时的讲话中再次提到了“政德”一次。那么何为政德呢？在我看来，政德就是大公无私，恪尽职守，坚定不二！大公无私，即执政人员抛下私我，一心为公！恪尽职守，即领导干部做好平时工作的每一步！坚定不二，即在诱惑和大风浪面前，坚守自我，不为所动！每个共产党人都应该拥有良好的政德，这是我们应做的！！',1,18340060),(235,'2019-03-10 22:31:03.535505','粤港澳大湾区如何比肩国际一流 代表委员开出创新“药方”','粤港澳大湾区能否比肩国际一流湾区，要靠创新，加强科技创新合作，营造有利于自主创新的社会环境，实现科技创新的抱团发展，要促进粤港澳三地共同探索，引导三地知识产权金融模式创新，为大湾区建设国际科技创新中心提供更好的现代化金融服务。',1,18340069),(236,'2019-03-10 22:42:05.960875','习近平等分别参加全国人大会议一些代表团审议','要坚持以人民为中心的创作导向，更好满足人民精神文化生活新期待。要做好退役军人工作，满腔热忱为他们服务。要贯彻新时代党的建设总要求，全面加强党的领导和党的建设。要把党中央、国务院决策部署贯彻落实到位，确保实现经济社会发展主要目标任务。要夯实乡村治理这个根基。采取切实有效措施，强化农村基层党组织领导作用，选好配强农村党组织书记，整顿软弱涣散村党组织，深化村民自治实践，加强村级权力有效监督。',1,17341096),(237,'2019-03-10 22:42:55.851851','习近平等党和国家领导人出席十三届全国人大二次会议开幕会','过去一年我国发展面临多年少有的国内外复杂严峻形势，经济出现新的下行压力。在以习近平同志为核心的党中央坚强领导下，全国各族人民以习近平新时代中国特色社会主义思想为指导，砥砺奋进，攻坚克难，完成全年经济社会发展主要目标任务，决胜全面建成小康社会又取得新的重大进展。',1,17341096),(238,'2019-03-10 23:07:39.339440','科研经费“包干制” 也要警惕成为创收捷径','科研经费使用问题是困扰科研工作人员已久的一个问题。更大自主权可以激发创新活力，新政充分体现了国家对科研人员的尊重与信任，将极大激发科研人员的创新活力，有利于鼓励更多年轻人愿意投入科研。这将会是一个制度体系的探索，最终达到提高科研效率、提高创新能力的目的。',1,18340076),(239,'2019-03-10 23:15:33.904920','长江经济带：生态优先 绿色发展','通过坚持实施最严格保护、坚持推进高质量发展，今天的长江经济带在不断释放巨大经济动能的同时，也在坚定地呵护绿水青山、留住诗情画意。使长江经济带正在成为绿色的经济带、协调发展的经济带和生态环境共治的样本。',1,18340076),(240,'2019-03-10 23:32:27.094659','第九讲：将全面深化改革进行到底','改革开放是当代中国发展进步的必由之路，是实现中国梦的必由之路。改革是实现中华民族伟大复兴的关键一招，当年改革开放的决定让我国走上了强起来的道路，如今我党做出了全面深化改革的重大决定，从社会各个方面进行深化改革，全面改革，将细则落实，对我国方方面面产生了诸多积极影响。改革开放一直会是我党最鲜明的旗帜',1,16337171),(241,'2019-03-10 23:32:42.699585','第十讲：坚定不移贯彻新发展理念','发展必须是科学发展，必须坚定不移贯彻创新、协调、绿色、开放、共享的发展理念。新发展理念有很丰富的内涵。创新是引领发展的第一动力；协调是持续健康发展的内在要求；绿色是永续发展的必要条件；开放是国家繁荣发展的必由之路；共享是中国特色社会主义的本质要求。他们相互贯通，相互促进，是具有内在联系的集合体，我们必须统一贯彻。',1,16337171),(242,'2019-03-10 23:33:04.069965','每日金句|习近平论政德','领导干部要讲政德。我们经常听到德智体美全面发展，德是排在第一位的，政德是整个社会道德间乡的风向标。每位干部都需要守公德，严私德，全心全意为人民服务，严格约束自己的操守和行为',1,16337171),(243,'2019-03-10 23:33:35.108826','向秀丽：党的好女儿','在熊熊大火面前，为了厂区和附近居民区居民的安危，党员向秀丽毫不犹豫的用自己的身躯扑向燃烧的酒精，避免了一场恶性爆炸事故的发生，但她自己却牺牲了自己的生命，她的行为令人钦佩。',1,16337171),(244,'2019-03-10 23:53:55.564092','为女性发声 促进职业发展','两性平等是一个宏大而复杂的话题，要在职场消除性别权利不平等现象，也绝不是一蹴而就的事。人社部印发的这份通知，细化了相关法律的精神，提出了明确的监管和处罚措施，是促进性别平等之路上的重要一步。但要真正保护女性的合法权益，还需要全社会一起努力，分摊生育成本，平衡各方利益，最终让整个社会受益。',1,17341099),(245,'2019-03-10 23:54:13.089853','第十二讲：开启全面建设社会主义现代化国家新征程','中国正处于社会发展的关键时期，全面建成小康社会的关键时期。而新时代，中国的发展更是要多元化，从经济，政治，文化，民生，社会，生态等多个方面协力发展。开启全面建设社会主义现代化国家新征程，就要分多步走，要稳健，况且现在社会发展要求也高了，所以我们更不能懈怠。',1,17341097),(246,'2019-03-10 23:55:05.222780','国际社会点赞中国新时代大国外交','中国已成为捍卫多边主义的重要力量，中方倡导的亚洲基础设施投资银行、“一带一路”等成为全球合作典范，对国际秩序产生了积极影响。',1,17341099),(247,'2019-03-10 23:57:07.812049','第十三讲：实现我国经济高质量发展','综合国力的强弱主要决定于经济实力的强弱。发展才是硬道理，只有经济上去了，生活水平才能上去，中国在国际的话语权才能提高。而经济的发展需要我们认识到新的观点，新的理念，要改革，要开放，从多个层面发展，做到齐头并进，有实力，有担当。我们还要灵活多变，让经济活起来！',1,17341097),(248,'2019-03-12 14:42:32.690077','总书记关心的身边事：不断提高人民健康水平','确实是，各地不论是绿化还是市民健身锻炼场所，做的都挺好，农村环境也发生的大变化。人民健康是民族昌盛和国家富强的重要标志，要重点关心独生子女父母亲的养老问题，独生子女工作压力大，没有时间照顾老人。而老龄化一天比一天加大，这个问题应该提到议事日程，具体的实施。',1,17341074),(249,'2019-03-12 14:43:59.842469','发动强军兴军的创新引擎——军队代表委员热议科技兴军','创新能力是一支军队的核心竞争力，也是生成和提高战斗力的加速器。抓创新就是抓发展，谋创新就是谋未来。军队科技工作者要大力弘扬‘两弹一星’精神、载人航天精神，在世界军事高科技竞争中主动作为，努力创造引领世界潮流的科技成果。',1,17341074),(250,'2019-03-12 14:46:33.508165','第十五讲：用更加健全的制度体系保证人民当家作主','中国是社会主义国家，是人民民主专政的国家。只有以人民为发展根本，才是富国强国之道。而要实现更进一步的民主，就要完善各种法律法规，依法治国，健全体制制度。人民代表大会就是很好的制度体现。我们应该坚持下去，以人民为基础，以党为领导，不断地走下去！',1,17341097),(251,'2019-03-12 14:49:51.497054','第十六讲：社会主义协商民主广泛多层制度化发展','社会主义协商民主广泛多层制度化发展是很重要的。中国是走社会主义道路了，所以要坚持中国共产党领导，聚集群众智慧。民主的表现形式有多种，我们要坚信一点，充分的民主体现在健全的制度上。很多届人民政治协商会议取得的成功我们有目共睹。新时代来了，我们相信，中国必将迎来更好的未来。',1,17341097),(252,'2019-03-12 15:18:57.509093','600字极简版！速读最高检工作报告！','3月12日，中国人民共和国最高人民检察院检察长张军在全国人大二次会议中，做出了去年一年的工作报告，期中提及了为民司法，诉讼监督，公益诉讼，提升能力和接受监督。用一系列的硬数据给予了我们满意的答复，每一次的办公，都是为民为公所做，践行社会主义的核心价值观。依法治国，中国将会越来越好',1,18340060),(253,'2019-03-12 15:58:13.231326','三分钟读懂最高法工作报告','最高法报告中体现了许多关于我国法律法规的思想内容，其中，有法可依，有法必依，违法必究，执法必严是我们建成社会主义法治国家的重要基础，必须严格依照法律法规，严厉打击黑恶势力和不法分子，稳固社会根基，服务经济发展、保障社会稳定、全面深化司法体制改革，加快推进队伍建设、防止“灯下黑”等都将是人民法院的工作重点。',1,17341073),(254,'2019-03-12 17:24:55.891640','习近平出席解放军和武警部队代表团全体会议','习近平强军思想，是习近平新时代中国特色社会主义思想的“军事篇”。确立习近平强军思想在国防和军队建设中的指导地位，对于实现党在新时代的强军目标、建成世界一流军队，乃至对于全面建成社会主义现代化强国、实现中华民族伟大复兴，都具有重大而深远的意义。',1,17341117),(255,'2019-03-12 17:25:46.676788','习近平：做实体经济要实实在在、心无旁骛做主业','实体经济是物质财富的源泉。财富是人类社会生存与发展的必要条件，主要来源于物质、精神产品和服务的生产、流通规模的扩大和积累。经济学在相当长的时间里认为物质产品是社会的真正财富，生产物质产品的实体经济则是社会物质财富的主要来源，而实体经济的规模和竞争力则决定了财富的数量和质量。',1,17341117),(257,'2019-03-12 19:16:16.494546','山西国土绿化迈出坚实步伐 3年累计营造林1378万余亩','中央提出了绿水青山就是金山银山的口号。不过要在建设好绿水青山的同时收获金山银山，还是具有一定的挑战性。需要前期一定的投入。我们要借鉴山西退耕还林，创造工作岗位，提高人民生活水平的优秀经验。真正落实时代发展的需要。',1,17341095),(258,'2019-03-12 19:22:56.395042','海南打造全国国产天然橡胶现货交易网络平台','中央成立了海南经济贸易试验区，推进了海南原生经济作物的商品化改革，增加了当地居民的收入。在种植技术的研发，交易平台的打造有好的经验。现在国家同时在大力推进西部大开发，西部要借鉴海南的经验，结合当地特色的经济作物，做好平台，实现商品化，这将为全面小康社会的实现打下坚定基础。',1,17341095),(259,'2019-03-12 22:28:17.509620','代表委员议国是：为全面建成小康社会收官打下决定性基础','今年是我国绝战全面建成小康社会、实现第一个百年奋斗目标的关键之年，习近平总书记强调，坚持稳中求进工作总基调，按照高质量发展要求，统筹推进各项工作，打下决定性基础。尤其是坚持农业农村优先发展、释放全社会创新创业创造动能、保持加强生态文明建设战略定力，弥补短板，高质量发展。',1,16337174),(260,'2019-03-12 22:36:04.899873','总书记关心的身边事：不断提高人民健康水平','人民的生活质量关乎着人民的健康水平，“没有全民健康，就没有全面小康”，社会发展的同时首先要关注人民健康水平，完善医疗保障体系，尤其是推进养老服务业的发展和建设，确保“老有所养、病有所医”。',1,16337174),(261,'2019-03-12 22:36:14.372163','每日金句|习近平论加快构建生态文明体系','要通过加快构建生态文明体系，使我国经济发展质量和效益显著提升，确保到2035年节约资源和保护环境的空间格局、产业结构、生产方式、生活方式总体形成，生态环境质量实现根本好转，生态环境领域国家治理体系和治理能力现代化基本实现，美丽中国目标基本实现。',1,18340069),(262,'2019-03-12 22:46:45.314045','第五讲：中国特色社会主义新时代标示我国发展新的历史方位','经过长期努力，中国特色社会主义进入了新时代，这是我国发展新的历史方位。从十九大到二十大，是两个一百年奋斗目标的历史交汇区，不仅要实现全面小康社会的目标，更要开启全面建设社会主义现代化国家的新征程。我们党在科学把握时代趋势和国际局势重大变化，科学把握世情国情党情深刻变化的基础上，作出了中国特色社会主义进入了新时代这一重大政治论断，反映了我国的实际状况，揭示了制约我国发展的症结所在，指明了解决当代中国发展主要问题的根本着力点。',1,16337174),(263,'2019-03-12 22:57:52.400668','第六讲：我国社会主要矛盾的变化是关系全局的历史性变化','中国特色社会主义进入新时代，我国社会主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾，反映了时代和实践要求。随着社会需求和社会生产两个方面情况的变化，我国的主要矛盾也经历了多次变化。根据详细的数据显示，我国社会生产力水平总体上显著提高，社会生产能力在很多方面进入世界强烈，更加突出的问题是发展不平衡、不充分，这是制约满足人民美好生活需要的主要因素，其他问题归根结底都是由此造成或派生而来。',1,16337174),(264,'2019-03-12 23:23:00.885757','每日金句|习近平论加快构建生态文明体系','绿水青山就是金山银山，注重生态效益可以带来发展质量和效益的提升。到本世纪中叶，建成富强民主文明和谐美丽的社会主义现代化强国，绿色发展方式和生活方式全面形成，人与自然和谐共生，生态文明建设必不可少，功不可没。',1,18340075),(265,'2019-03-12 23:27:46.483683','两会经济观察：供给侧结构性改革的成果要巩固更要提升','尽管2018年国内外形势严峻，但我国仍然完成全年经济社会发展主要目标任务，更为可喜的是，供给侧结构性改革不断深化，实体经济活力持续释放。思危方能居安，供给侧结构性改革的成果要巩固更要提升，这样才能增强微观主体活力，继续推动中国经济高质量发展。',1,18340076),(266,'2019-03-12 23:31:54.772086','这项最普惠的民生工程 习近平始终念兹在兹','要加强宣传教育，创新活动形式，引导广大人民群众积极参加义务植树，不断提高义务植树，义务严格保护森林，增强义务植树效果，把义务植树深入持久开展下去，为全面建成小康社会，实现中华民族伟大复兴的中国梦不断创造更好的生态条件',1,17341096),(267,'2019-03-12 23:34:39.197415','每日科普|中国北斗系统怎样服务全球？','北斗系统是中国自主建设、独立运行，与世界其他卫星导航系统兼容共用的全球卫星导航系统。对我国国家安全具有无可替代的重大意义，也在我国国民经济、百姓生活等方面得到广泛应用，同时走出国门惠及世界。未来我国导航系统必将登上新的高峰。',1,18340076),(268,'2019-03-12 23:36:34.891428','代表委员议国是：为全面建成小康社会收官打下决定性基础','坚持稳中求进工作总基调，按照高质量发展要求，统筹推进稳增长、促改革、调结构、惠民生、防风险、保稳定各项工作，保持经济持续健康发展和社会大局稳定，为全面建成小康社会收官打下决定性基础。建议大力借助现代科技手段更好摸清草原资源家底，遵循生态系统内在的机理和规律，因地制宜、分类施策。',1,17341096),(269,'2019-03-12 23:45:12.680738','第十三讲：实现我国经济高质量发展','我国经济已经从高速增长阶段进入高质量发展阶段，我们需要引领经济发展新常态，把推进供给侧结构性改革作为经济工作的主线，继续解决和发展社会生产力，减少无效和低端供给，扩大有效和中高端供给，增强供给结构对需求变化的适应性和灵活性，提高全要素生产率。',1,16337171),(270,'2019-03-12 23:45:19.927172','习近平出席解放军和武警部队代表团全体会议','通过学习，我们了解到要围绕规划明确的总体布局，突出抓好军事斗争准备急需、作战体系关键支撑、国防和军队改革配套等重点项目，确保重大建设任务落地、关键能力指标实现。要加大攻关力度，加快建设进程，把住时间节点、质量要求，实现进度和标准一起抓。要抓住政策制度改革契机，抓紧健全军事力量建设和军事管理等方面政策制度，为规划任务落实提供有力保障。',1,17341114),(271,'2019-03-12 23:45:42.086568','第十四讲：形成全面开放新格局','开放带来进步，封闭必然落后，中国开放的大门不会关闭，只会越开越大。我国要坚持对外开放，顺应经济全球化潮流，才能更好实现可持续发展。融入世界经济是历史大方向。中国经济要敢于到世界市场的汪洋大海中去游泳。如今我们成功做到了。我们还带领了一带一路亚投行，建立了开放型经济新体制，创建了全方位对外开放新格局。',1,16337171),(272,'2019-03-12 23:46:42.643984','每日金句|习近平论加快构建生态文明体系','生态文明建设功在当代、利在千秋。紧密团结在以习近平同志为核心的党中央周围，充分发挥党的领导和我国社会主义制度能够集中力量办大事的政治优势，加大力度推进生态文明建设、解决生态环境问题，我们就一定能推动形成人与自然和谐发展现代化建设新格局，让中华大地天更蓝、山更绿、水更清、环境更优美',1,17341114),(273,'2019-03-12 23:50:42.192559','每日金句|习近平论加快构建生态文明体系','人应与自然和谐共生，我们要加快构建生态文明体系，全面形成绿色发展方式和生活方式，全面实现生态环境领域国家治理体系和治理能力现代化，早日建成美丽中国',1,16337171),(274,'2019-03-12 23:52:04.969312','这项最普惠的民生工程 习近平始终念兹在兹','植树造林是实现天蓝、地绿、水净的重要途径，是最普惠的民生工程。NASA前段时间公布的数据显示，地球现在有了更多的植被覆盖，而我国的做出了极大的贡献。前人种树后人乘凉，我们都是乘凉者，但更要做一个种树者',1,16337171),(275,'2019-03-13 09:14:00.000000','代表委员议国是：为全面建成小康社会收官打下决定性基础','正如总书记调研时强调的，我们要坚持稳中求进工作总基调，按照高质量发展要求，统筹推进稳增长、促改革、调结构、惠民生、防风险、保稳定各项工作，保持经济持续健康发展和社会大局稳定，为全面建成小康社会收官打下决定性基础。全面建成小康社会需要全社会大家共同努力。',1,17341074),(276,'2019-03-13 09:18:00.000000','央视快评：力戒形式主义 切实为基层减负','为基层松绑减负的务实措施把力戒形式主义、官僚主义作为重要任务。要树立正确的政绩观，以实际行动践行“以人民为中心”的执政理念。必须彻底治理重形式轻落实、以形式代替落实等顽瘴痼疾，倡导实干，为广大基层干部减负。',1,17341074),(277,'2019-03-13 08:18:00.000000','从全国两会看奋进中国的发展活力','全国两会中提出了许多关于发展的理念，谋创新、促改革、抓机遇的氛围格外热烈。坚定信心，咬定高质量发展目标，奋进中国的发展活力更加激越澎湃。政府报告中多次强调创新，创新已是新时代发展的主题，创新就像挖一口深井，过程艰难，但成功后活水就源源不断，我们要坚持创新，持续发展',1,17341073),(278,'2019-03-13 09:49:00.000000','习近平出席解放军和武警部队代表团全体会议','总书记强调要打好我军建设发展“十三五”规划落实攻坚战确保如期完成国防和军队建设目标任务，要围绕规划明确的总体布局，突出抓好军事斗争准备急需、作战体系关键支撑、国防和军队改革配套等重点项目，确保重大建设任务落地、关键能力指标实现，为新时代强军目标的早日实现奠定基础。',1,18340069),(279,'2019-03-13 10:46:00.000000','两会观察：外商投资法草案释放了五大信号','制定外商投资法，是中国扩大对外开放、促进外商投资的重要举措。外商投资法草案释放了中国全面开放、高水平开放的强烈信号，预示着世界第二大经济体将以更大力度、更积极的姿态融入到全球化发展进程中。',1,17341099),(280,'2019-03-13 10:55:00.000000','习近平看望参加政协会议的文艺界社科界委员','新时代呼唤着杰出的文学家、艺术家、理论家，文艺创作、学术创新拥有无比广阔的空间，要坚定文化自信、把握时代脉搏、聆听时代声音，坚持与时代同步伐、以人民为中心、以精品奉献人民、用明德引领风尚。',1,17341099),(281,'2019-03-13 10:55:00.000000','第十七讲：加快建设社会主义法治国家','加快建设社会主义法治国家，健全法治，依法治国。中国正处于发展的绝佳时期，制度上来了，经济才能上来，综合实力才能上来。而走这条路，又必须是自己的路，特色的路。各级政府都应该在党的领导下，走唯一正确的中国特色社会主义道路，这样下来，中国才能更好的发展。',1,17341097),(282,'2019-03-13 11:02:00.000000','第十八讲：推动社会主义文化繁荣兴盛','文化是一个国家、一个民族的灵魂。文化兴国运兴，文化强民族强。没有高度的文化自信，没有文化的繁荣兴盛，就没有中华民族伟大复兴。为了提高自信，我们应该坚持社会主义核心价值观不动摇，相信国家，相信党，珍惜传统文化精髓。从小处，从大局，我们都要对中华文化有自信。',1,17341097),(283,'2019-03-13 11:40:00.000000','第七讲：坚持党对一切工作的领导','坚持党对一切工作的领导是非常重要的中国共产党对一切工作的领导是中国特色社会主义最基本的特指。习近平总书记党中央的核心，全党的核心地位，是在伟大斗争中取得的，我们应该拥护这一伟大制度。这样我们的工作才能更好的发展进行',1,17341105),(284,'2019-03-13 11:50:00.000000','2019年两会，习近平六下团组讲话重点全在这里','习近平总书记在今年的两会期间，六下团组讲话，讲话内容涉及各方各面。在参与文艺社科的讨论中说到，媒体要为民而工作，要求真实而且精品。在与内蒙古代表团的讲话中，强调要坚持生态发展。在其他的谈话中更是把扶贫攻坚列为了重中之重，要求“不获全胜，决不收兵！”这是共产党的决心，更是全中国人民的决心！！',1,18340060),(286,'2019-03-13 16:16:39.705664','每日金句|习近平论中国共产党领导的多党合作和政治协商制度','中国共产党领导的多党合作和政治协商制度，中国特色的政党制度，是我国的一项基本政治制度。中国共产党执政的实质，是代表广大人民掌握人民民主专政的国家政权。各民主党派参政的基本点是：参加国家政权，参与国家大方针和国家领导人选的协商，参与国家事物的管理，参与国家方针、政策、法律、法规的制定和执行。',1,17341117),(322,'2019-03-13 16:16:00.000000','中国载人深潜向海底一万米进发 2020年将投入使用','创新是一个民族进步的灵魂，是一个国家兴旺发达的不竭动力。科学技术的本质就是创新。我国是一个发展中国家，要想赶超发达国家，关键要靠创新。只有把科技进步的基点放在增强自主创新能力和持续创新能力上，才能实现我国科学技术的跨越式发展，真正掌握发展的主动权。没有创新，就要受制于人；没有创新，就不可能赶超发达国家。',1,17341117),(323,'2019-03-13 16:29:00.000000','习近平等出席十三届全国人大二次会议第三次全体会议','人大二次会议在协调中国发展，加快中国社会主义步伐上有着极大的重要性。各领导都就社会各方面问题提出了见解和做法。相信，坚持共产党领导，有条理地解决问题，中国会越来越好',1,17341097),(324,'2019-03-13 16:29:00.000000','习近平参加福建代表团审议讲话金句','“为中小企业、年轻人发展提供有利条件，为高技术企业成长建立加速机制。”习主席的这句话无疑是时代的强音。当今社会是青年的社会，只有青年强国才强，鼓励小企业、青年发展，有利于提高中国的经济活力',1,17341097),(326,'2019-03-13 20:29:00.000000','第七讲：坚持党对一切工作的领导','中国共产党领导是中国特色社会主义最本质的特征。中国的地域辽阔，人口基数大，要把众人的思想和力量统一起来建设社会主义，必须由一个具有高度觉悟性、纪律性和自我牺牲精神的党员组成的能够真正代表和团结人民群众的党的领导。中国特色社会主义是党领导人民经过长期探索取得的根本成就，也只有在党的领导下才能不断向前发展。坚持党对一切工作的领导，坚决维护习近平总书记党中央的核心、全党的核心地位。',1,16337191),(327,'2019-03-13 21:24:27.803401','第九讲：将全面深化改革进行到底','1978年12月，党的十一届三中全会作出改革开放伟大决策。我国经济高速发展，取得了许多辉煌的成绩，经济总量稳居世界第二，人民由满足物质文化生活需要向美好生活目标迈进。全面深化改革的总目标是完善和发展中国特色社会主义制度、推进国家治理体系和治理能力现代化。这里面最核心的是坚持和改善党的领导、坚持和完善中国特色社会主义制度。',1,16337191),(328,'2019-03-13 23:48:00.000000','第十五讲：用更加健全的制度体系保证人民当家作主','人民当家作主是我国核心制度之一，是我们党矢志不渝的奋斗目标。国家的一切权力属于人民，人民依照法律法规，通过各种途径和形式，管理国家事务、经济文化事业、社会事务。我们要始终以人民为中心，维护最广大人民根本利益。',1,16337171),(330,'2019-03-13 23:40:00.000000','共和国是红色的！习近平今年两会这样谈“初心”','要有不怕疲劳、连续作战的顽强作风，要解决现实问题，病急乱投医、崇洋媚外是不行的。要把中国的事情搞清楚，把好脉。要“确保老区苏区在全面建成小康社会进程中一个都不掉队”。“要梳理排查、抓紧工作”，“要坚持精准扶贫、精准脱贫，找到问题根源，增强脱贫措施的实效性”',1,17341096),(331,'2019-03-13 23:42:00.000000','每日金句|习近平论中国共产党领导的多党合作和政治协商制度','坚持中国共产党的领导，不是不要民主了，而是要形成更广泛、更有效的民主。我们应该不忘多党合作建立之初心，坚定不移走中国特色社会主义政治发展道路，把我国社会主义政党制度坚持好、发展好、完善好，政治协商、民主监督、参政议政，就是这种民主最基本的体现。坚持中国共产党的领导，不是不要民主了，而是要形成更广泛、更有效的民主。',1,17341096),(333,'2019-03-13 23:48:37.378363','人工智能发展亟待法律“画方圆”','及时考虑人工智能立法事宜是明智之举。当下人工智能技术的创新节奏不断加快，应用场景也日新月异。人工智能的领地早已不限于下围棋和充当智能手机助手，制造、仓储、交通、汽车、教育、医疗、金融、家居、陪护、娱乐、服务等各行各业都可看到人工智能的身影',1,17341114),(334,'2019-03-13 23:50:10.593629','十八大以来，中央给基层干部减了哪些负','“减负”并不是终极目的，中央提出解决形式主义、为基层松绑“减负”，就是将广大基层干部“从一些无谓的事物中解脱出来”，从提供材料的忙乱中解放出来，激励他们担当作为，崇尚实干，把更多精力用在打好三大攻坚战、推动高质量发展上',1,17341114),(335,'2019-03-13 23:57:01.364403','1分40秒飞越中国，鸟瞰春耕开犁忙','一年之计在于春，农民伯伯农务忙。此下正是阳春三月，春暖花开，是播种希望的季节。我们要把握住这美好春光，才能把握住这接下来的这一年。有付出才可能有收获，拒绝浮躁，脚踏实地。新学期，新气象!',1,17341095),(336,'2019-03-14 00:12:21.921648','共和国是红色的！习近平今年两会这样谈“初心”','靡不有初，鲜克有终。我们的初心是什么?习总书记简明的一针见血的指出了。共和国是红色的，努力建设社会主义强国是我们不可更改的理想。勤俭节约，艰苦奋斗是我们中华民族的传统美德，我们不能因为慢慢经济条件好了就丢失了这些宝贵的品质，我们要从我做起，从身边的小事做起。不忘初心，方得始终!',1,17341095),(337,'2019-03-13 23:26:00.000000','共和国是红色的！习近平今年两会这样谈“初心”','共和国是红色的，如今我国的经济发展起来了，但我们也还是要艰苦奋斗，勤俭节约，反对浪费。这种思想永远不能丢',1,16337171),(338,'2019-03-13 23:26:00.000000','每日金句|习近平论中国共产党领导的多党合作和政治协商制度','我国坚持中国共产党领导的多党合作和政治协商制度，强调社会主义民主。我们要坚定不移的走中国特色社会主义政治发展道路，把我国社会主义政党制度坚持好、发展好、完善好',1,16337171),(339,'2019-03-13 23:29:00.000000','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','中国特色社会主义是党和人民付出各种代价取得的宝贵成果，具有非常重大的历史意义。坚持中国特色社会主义的道路，只有坚持中国特色社会主义才能实现中华民族的伟大复兴。',1,16337129),(340,'2019-03-14 07:28:14.596657','共和国是红色的！习近平今年两会这样谈“初心”','艰苦奋斗、勤俭节约是中华民族的传统美德，是我们党的传家宝，也是新形势下加强领导干部作风建设的一个重要方面。“艰难困苦，玉汝于成”、“居安思危，戒奢以俭”。中华民族历来以勤劳勇敢、不畏艰苦著称，历来讲求勤俭持家，勤俭办一切事情。我们党是靠艰苦奋斗成长壮大、成就伟业的，是靠勤俭节约发展事业、建设国家的。',1,17341117),(341,'2019-03-14 07:29:17.490992','每日金句|习近平论全面深化改革','创新是一个民族进步的灵魂,是一个国家兴旺发达的不竭动力。文化创新可以推动社会实践的发展,这是文化创新的根本目的,也是检验文化创新的标准所在，能促进民族文化的繁荣,是一个民族永葆生命力和富有凝聚力的重要特征',1,17341117),(342,'2019-03-14 08:17:29.286083','习近平出席解放军和武警部队代表团全体会议讲话金句','要搞好全局统筹，统好任务计划、力量资源、管理流程，确保各项建设有序推进。各级要树立过紧日子思想，严格执行中央八项规定精神和军委十项规定，发扬艰苦奋斗优良作风，把钱用在刀刃上。而军民团结是我军的优良传统，应该坚持为人民服务的思想。',1,18340069),(343,'2019-03-14 08:18:55.782832','每日金句|习近平论全面深化改革','事业发展没有止境，深化改革没有穷期；事业发展全面推进，呼唤着改革全面深化。新时代坚持和发展中国特色社会主义，根本动力仍然是全面深化改革。在新时代的征程上，全党同志一定要适应新时代中国特色社会主义事业发展进程，牢牢把握完善和发展中国特色社会主义制度、推进国家治理体系和治理能力现代化的总目标，统筹推进各领域各方面改革。',1,18340069),(344,'2019-03-14 09:50:00.000000','习近平出席解放军和武警部队代表团全体会议讲话金句','军政军民团结是我们的优良传统和政治优势。国防力量是为了保卫国家，维护治安稳定不可忽视的因素。统筹当前建设实际和长远发展需要，做好需求论证、规划衔接、任务对接，确保国防和军队现代化建设接续推进。国家要把军队建设成为一支能打胜仗，作风优良的人民子弟兵。',1,17341074),(346,'2019-03-14 09:54:00.000000','王有德：筑起消弭沙漠的绿色长城','这个世界治沙史的奇迹，是王有德带着林场职工，在年降水量不到200毫米的沙漠中实现的！这就是实实在在的贡献！这就是最朴实的爱国！而这个世界治沙史的奇迹，是王有德带着林场职工，在年降水量不到200毫米的沙漠中实现的！这就是实实在在的贡献！这就是最朴实的爱国！我们要谨记：绿水青山就是金山银山，我们要给后人留下宝贵的环境财富！',1,17341074),(349,'2019-03-14 13:11:00.000000','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','正如习近平总书记所说：只有社会主义才能救中国,只有中国特色社会主义才能发展中国,才能实现中华民族伟大复兴。坚持好、发展好中国特色社会主义,把我国建设成为社会主义现代化强国，是一项长期任务,需要一代又一代人接续奋斗。为了实现伟大的共产主义，我们这一代青年应该跟随共产党的脚步，继续发展中国特色社会主义，同时要有四个自信——中国特色社会主义道路自信、理论自信、制度自信、文化自信！历史和现实都告诉我们,一场社会革命 要取得最终胜利,往往需要一个漫长的历史过程。我们要做的即是多好我们所处的过程中的每一个细节。',1,18340060),(350,'2019-03-14 14:22:15.116678','第十讲：坚定不移贯彻新发展理念','2008年国际金融危机深层次影响持续蔓延，世界经济进入深度调整期，国际贸易低迷。过去发展中简单地追求增长速度已经行不通，必须确立新发展理念来引领和推动我国经济从高速增长阶段转向高质量发展阶段。发展不平衡不充分的一些突出问题尚未解决，群众在就业、教育、医疗、居住、养老等方面面临不少难题。必须树立创新、协调、绿色、开放、共享的发展理念，提高贯彻新发展理念的能力和水平。',1,16337191),(351,'2019-03-14 14:31:34.639356','第十一讲：决胜全面建成小康社会','20世纪90年代，党的十五大提出21世纪中国社会发展的“三步走”发展目标。全面建成小康社会是实现中华民族伟大复兴的重要基础、关键一步。“小康”讲的是发展水平，“全面”讲的是发展的平衡性、协调性、可持续性。目前，经过发展，创新驱动成效显著，人民生活水平和质量普遍提高，生态环境质量总体改善。全党全国各族人民要继续团结一致，夺取决胜全面建成小康社会的伟大胜利。',1,16337191);
